import React, {Component} from "react";
interface IProps {
}

export default class Register extends Component {
    constructor(props: IProps) {
        super(props);

        this.state = {
            item: []
        };
    }
    componentDidMount() {
        fetch('api/customer/')
            .then(response => response.json())
            .then(data => this.setState({item: data[0]}));
    }

    render() {
        return (<div className='home-wrap'>
            {this.state.item}
        </div>)
    }
}
